// Home.tsx
import React from "react";
import "./styles.css"; // Make sure this path is correct
import { useHistory } from "react-router-dom"; // Import useHistory hook

function Home() {
  const history = useHistory(); // Hook to access the history instance

  // Function to handle login navigation
  const navigateToLogin = () => {
    history.push("/login"); // Change '/login' to your actual login route
  };

  return (
    <div className="home-container">
      <div className="content">
        <h1>Welcome to BMW Cars</h1>
        {/* Button to navigate to the login page */}
        <button className="login-button" onClick={navigateToLogin}>
          Login
        </button>
      </div>
    </div>
  );
}

export default Home;
